import React from 'react'
import { Route, BrowserRouter as Router } from 'react-router-dom';
import Login from './pages/Login';


const AppRouter = () => {
    return (
    <Router>
        <Route path='/' element={<Login />}/>
    </Router>
  )
}

export default AppRouter
